CREATE TABLE IF NOT EXISTS pais (
  id INT NOT NULL AUTO_INCREMENT,
  codigo VARCHAR(3) NOT NULL,
  nome VARCHAR(100) NOT NULL,
  PRIMARY KEY (id),
  UNIQUE INDEX codigo_UNIQUE (codigo ASC),
  UNIQUE INDEX nome_UNIQUE (nome ASC)
);

CREATE TABLE IF NOT EXISTS unidade_federativa (
  id INT NOT NULL AUTO_INCREMENT,
  codigo VARCHAR(2) NOT NULL,
  nome VARCHAR(100) NOT NULL,
  pais_id INT NOT NULL,
  PRIMARY KEY (id),
  UNIQUE INDEX codigo_UNIQUE (codigo ASC),
  UNIQUE INDEX nome_UNIQUE (nome ASC),
  INDEX pais_id_ind(pais_id),
  FOREIGN KEY (pais_id) REFERENCES pais(id)
);

CREATE TABLE IF NOT EXISTS municipio (
  id INT NOT NULL AUTO_INCREMENT,
  nome VARCHAR(100) NOT NULL,
  unidade_federativa_id INT NOT NULL,
  PRIMARY KEY (id),
  INDEX nome_ind(nome),
  INDEX unidade_federativa_id_ind(unidade_federativa_id),
  FOREIGN KEY (unidade_federativa_id) REFERENCES unidade_federativa(id)
);



